        <p className="list-name">Salário - Dezembro</p>
        <p className="list-description">Entrada</p>
      </div>
      <div className="separator">
        <p className="list-value">R$ 6,050</p>
        <BiXCircle className="delete_icon" />
      </div>
    </li>
  );
}
